import React from "react";
import { Col, Row } from "react-bootstrap";
import BackImage from "./../../resources/Back.png";
import SearchImage from "./../../resources/search.png";
import "./SearchBox.scss"

const SearchBox = () => {

    return <>
        <Row className="search-box-container">
            <Col xs={2}><img src={BackImage} /></Col>
            <Col xs={8}><input placeholder="" type="text"></input></Col>
            <Col xs={2}><img src={SearchImage} /></Col>
        </Row>
    </>

}

export default SearchBox;
